  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mark Twain
  National Wildlife Refuge outlines Refuge accomplishments during the 1975 fiscal
  year. The report begins by summarizing the weather conditions and habitat conditions
  during the year. Wildlife- including migratory birds, upland game birds, big game
  animals, furbearers, predators, rodents, raptors, rare and endangered species, and
  fish- is also covered. The Refuge development and maintenance section discusses
  physical developments, plantings, vegetation control, and prescribed fires. Resource
  management is outlined; topics include commercial fishing. A progress report on
  field investigations and applied research is also provided. The public relations
  section of the report describes recreational uses, Refuge visitors, Refuge participation,
  hunting, violations, and safety. Items of interest and photographs are attached.\",\n\t\"owner_org\":
